import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";
import React from "react";

function OrderFormSummarize({title = 'undefined', balance = 0, price = 0, ...props}) {
    return (
        <Grid container>

            <Grid item xs={12}>
                <Box mt={2}>
                    <Typography>
                        Название: {title}
                    </Typography>
                    <Typography>
                        Цена: {price} $
                    </Typography>
                    <Typography>
                        Текущий баланс: {balance} $
                    </Typography>
                </Box>
            </Grid>

        </Grid>
    )
}

export default OrderFormSummarize
